import React from 'react';
import Card from 'react-bootstrap/Card';

export default function BookResult(props) {

    return (
        <Card>
            <h1>{props.title}</h1>
            <h2>{props.author(props.authors)}</h2>
            <img src={props.image} alt={props.title}></img>
        </Card>
    )
}
